import { Container, Row, Col } from "shards-react";
import Heading from "./components/Heading/Heading.js";
import Daily from "./components/Daily/Daily.js";
import BobaTracker from "./components/BobaTracker/BobaTracker.js";

import "bootstrap/dist/css/bootstrap.min.css";
import "shards-ui/dist/css/shards.min.css";
import "./App.css";

function App() {
  return (
    <Container
      className="wrapper"
      style={{
        justifyContent: "center",
        alignItems: "center",
      }}
    >
      {/* HEADING */}
      <Row>
        <Col sm="12" lg="9" className="block">
          <Heading />
        </Col>
      </Row>
      {/* DAILY */}
      <Row>
        <Col sm="12" lg="8" className="blue block">
          <Daily />
        </Col>
      </Row>
      {/* FINANCIALS */}
      <Container className="border green block"></Container>
      {/* COFFEE */}
      <Container className="border pink block"></Container>
      {/* BOBA */}
      <Container className="border brown block"></Container>
    </Container>
  );
}

export default App;
